import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import Typography from '../materialUiComps/Typography';

const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1,
  },
  img: {
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
}));

export default function CenteredGrid() {
  const classes = useStyles();

  return (
    <React.Fragment>
       <Typography variant="h3" marked="center" align="center" component="h2">
          Our Partnerships
      </Typography>
      <Grid container>
        <Grid item sm>
          <img src="https://heidipozzo.com/wp-content/uploads/2018/05/Girl-Scouts-of-the-USA-logo-old.png"
           width="330"
          ></img>
        </Grid>
        <Grid item sm>
        <img src="https://www.logomaker.com/wp-content/uploads/2018/05/PANDA-202x300.png"
        width="200"
       ></img>
        </Grid>
        <Grid item sm>
        <img src="https://venngage-wordpress.s3.amazonaws.com/uploads/2019/04/nonprofit-logo.png"
        width="330"
       ></img>
        </Grid>
      </Grid>
    </React.Fragment>
  );
}

